  function funcSearch() {
    const els = doc.gcn("wrap")[0].gtn("a");
    const dictCourse = {
      11: "Australasia",
      22: "Europe",
      33: "USA",
    };
    const result = [];
    Array.from(els).forEach((el) => {
      if(el.str() != "변경") return true;

      const param = el.attr("onclick").inparen();
      const date = param[0];
      const time = param[2];
      const mCourse = param[1];
      log("reserve search", dictCourse[mCourse], date, time);
      result.push({ date, time, course: dictCourse[mCourse] });
    });
    const param = {
      command: "SUCCESS_OF_RESERVE_SEARCH",
      golf_club_id: "4f44a7e1-7c51-11ec-b15c-0242ac110005",
      device_id: "${deviceId}",
      result,
    };
    const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
    post(addr, param, { "Content-Type": "application/json" }, (data) => {
      console.log(data);
      LOGOUT();
    });
  }
